function Timer(props: { minute: string; seconds: string }) {
  return (
    <div className="parent-div">
      <div className="flex items-center w-20 rounded-lg h-9 bg-darkGray">
        <div className="flex items-center h-8 text-white rounded-md inner space-around w-18">
          <div className="minute-box">
            <p>{props.minute}</p>
          </div>
          <div className="second-box">
            <p>{props.seconds}</p>
          </div>
        </div>
      </div>
      <div className="timer-button"></div>
    </div>
  );
}
export default Timer;
